import React from 'react';
import '../style/headTitle.css'
import oval from '../assets/oval.png'


export default class HeadTitle extends React.Component{
    constructor(props){
        super(props);
        this.state = {

        }
    }

    render () {
        const { thirdPartFont } = this.props;
        return (
            <div className='headDiv'>
                <div className='firstPart'>
                    {this.props.children}
                    <img className='ovalImg' src={oval}></img>
                </div>
                <div className='secondPart'></div>
                <div className='thirdPart'>{thirdPartFont}</div>
            </div>
        )
    }

}
